import {BrowserRouter, Routes, Route} from "react-router-dom"
import Students from "./comp/student.jsx"
import Navbar from "./comp/navbar.jsx"
import Lecturers from "./comp/lecturer.jsx";
import Departments from "./comp/department.jsx";
import './App.css';

function App() {
  return (
    <div className="App">
        <Navbar />
        <BrowserRouter>
          <Routes>
            <Route path="/allstudents" element = {<Students/>}/>
            <Route path="/alllecturers" element = {<Lecturers/>}/>
            <Route path="/alldepartments" element = {<Departments/>}/>
          </Routes>
        </BrowserRouter>

    </div>
  );
}

export default App;
